import axios from 'axios';

const baseURL = process.env.REACT_APP_BASE_URL;

axios.defaults.withCredentials = true;

export const Login = async (data) => {
  return await axios.post(`${baseURL}/login`, {
    id: data.id,
    password: data.password,
  });
};
